// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./MetaverseNFT721.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Metaverse721Wallet is AccessControlEnumerable, EIP712, ReentrancyGuard, Ownable {

  bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
  string private constant SIGNING_DOMAIN = "Metaverse721Wallet";
  string private constant SIGNATURE_VERSION = "4";

  MetaverseNFT721 NFTAddress;

  constructor(address _metaverseNFT721) EIP712(SIGNING_DOMAIN, SIGNATURE_VERSION) {
    NFTAddress = MetaverseNFT721(_metaverseNFT721);
  }

  function vendingMachine(string memory myUri) payable public {
    require(msg.value >= 0.2 ether, "insufficient funds");

    NFTAddress.safeMint(address(this), myUri);
  }


  function transferTo(address tokenAddress, uint256 tokenId, address to) public onlyOwner {
    IERC721(tokenAddress).transferFrom(address(this), to, tokenId);
  }
}
